import React, { useState } from "react";
import "./content.scss";


function Curriculum() {
  let CVEn = require('../Data/LinsAraujoCV_En.png');
  return (
    <div>
      <h1>CV</h1>
      <ul>

        <a href="https://bit.ly/3coQnrG" target="_blank">
          <img src={CVEn} />
        </a>
      </ul>
    </div>
  );
}

export default Curriculum;
